import React from 'react';

const Profile = () => {
    return (
        <div className='content'>
            <div>
                <img src="https://hatrabbits.com/wp-content/uploads/2017/01/random.jpg" alt="content-img"/>
            </div>
            <div>
                ava + description
            </div>
            <div>
                My posts
                <div>
                    New post
                </div>
                <div>
                    post 1
                </div>
                <div>
                    post 2
                </div>
            </div>
        </div>
    );
};

export default Profile;
